int findDifference(int array[], int n) 
{   
    int max = 0; 
    int min = array[0]; 

    // Find maximum and minimum element in array 
    for (int i = 0; i < n; i++)  
    { 
        if (array[i] > max) 
            max = array[i]; 

        if (array[i] < min) 
            min = array[i]; 
    } 
    return (max - min); 
} 

