def get_permutations(string):
    if len(string) == 0:
        return []
    if len(string) == 1:
        return [string]

    permutations = []
    for i, char in enumerate(string):
        for permutation in get_permutations(string[:i] + string[i+1:]):
            permutations.append(char + permutation)

    return permutations

