    for i in range(9):
        sum += (i+1) * int(isbn[i])
    check_digit = sum % 11

    # Check if the check digit matches the last character of the ISBN.
    if check_digit == 10 and isbn[-1].upper() != 'X':
        return False
    elif check_digit < 10 and int(isbn[-1]) != check_digit:
        return False
    else:
        return True

