                containsUpperCase = true;
            } else if (Character.isLowerCase(c)) {
                containsLowerCase = true;
            } else if (Character.isDigit(c)) {
                containsDigit= true;
            }
        }
        return containsUpperCase && containsLowerCase && containsDigit;
    }

