def breadthFirstSearch(root, target):

    if root is None:
        return False

    queue = [root]

    while len(queue) > 0:
        node = queue.pop(0)
        if node.val == target:
            return True

        if node.left is not None:
            queue.append(node.left)
        if node.right is not None:
            queue.append(node.right)

