#include<stdio.h>

// Function to remove duplicates from an array
void RemoveDuplicates(int arr[], int n)
{
    // Existing elements in array
    int temp[n];

    // Initialize the elements of temp[] 
    for (int i=0; i<n; i++)
        temp[i] = arr[i];

    // Sort temp[]
    for (int i=0; i<n-1; i++)
        for (int j=i+1; j<n; j++)
            if (temp[i] > temp[j])
            {
                int t = temp[i];
                temp[i] = temp[j];
                temp[j] = t;
            }

    // Index of next unique element
    int j = 0;

    // Traverse temp[] and make unique elements 
    // of arr[]
    for (int i=0; i<n-1; i++)
        if (temp[i] == temp[i+1])
            continue;
        else
            temp[j++] = arr[i];

    // Set the last element as the only 
    // unique element
    temp[j++] = arr[n-1];

    // Copy the updated temp[] to arr[]
    for (int i=0; i<j; i++)
        arr[i] = temp[i];
}

