    double julianDayNumber = 367*year - 
    (7.0/4.0) * (year + (month + 9)/12.0) + 
    (275.0/9.0)*(month) + day - 719561.5;

    double modifiedJulianDayNumber = julianDayNumber + (hour + (minute + (second/60.0))/60.0)/24.0;

    return modifiedJulianDayNumber;
}

