public class LinkedListCloneExample {

    static Node head;

    static class Node {
        int data;
        Node next;

        Node(int d) {
            this.data = d;
            this.next = null;
        }
    }

    static Node CloneList(Node node) { 
        Node curr = node; 
        Node next = null; 
        Node temp = null; 

        while (curr != null) { 
            next = curr.next; 

            // Cloned node 
            temp = new Node(curr.data); 

            // Inserting the cloned node 
            // just next to the original node. 
            temp.next = next; 
            curr.next = temp; 

            curr = next; 
        } 

        // Adjusting the original list 
        // to get the cloned list. 
        curr = node; 
        while (curr != null) { 
            next = curr.next; 

            // Just adapting the original 
            // list to the cloned list. 
            curr.next = next.next; 

            curr = next.next; 
        } 

        return node; 
    } 

    static void printList(Node node) { 
        while (node != null) { 
            System.out.print(node.data + " "); 
            node = node.next; 
        } 
    } 

    public static void main(String[] args) { 
        head = new Node(1); 
        head.next = new Node(2); 
        head.next.next = new Node(3); 
        head.next.next.next = new Node(4); 

        System.out.println("Linked List original: "); 
        printList(head); 

        System.out.println("\nCloned Linked List: "); 
        Node cloned_list = CloneList(head); 
        printList(cloned_list); 
    }

#include <bits/stdc++.h> 
using namespace std; 

int getSingle(int arr[], int n) 
{ 
	// initialize result 
	int result = 0; 

	// Iterate through every bit 
	for (int i = 0; i < 32; i++) 
	{ 
		// Find sum of set bits at i'th position in all 
		// array elements 
		int x = 0; 
		for (int j = 0; j < n; j++) 
			x += (arr[j] & (1 << i)); 

		// The bits with sum not multiple of 3, are the 
		// bits of element with single occurrence. 
		if (x % 3) 
			result |= (1 << i); 
	} 

	return result; 
} 

