public static List<Object> flattenArray(List<Object> arr) { 

    List<Object> result = new ArrayList<>(); 

    for (int i = 0; i < arr.size(); i++) { 

        if (arr.get(i) instanceof List<?>) { 

            List<Object> flat = flattenArray((List<Object>) arr.get(i)); 
