using namespace std;

class Stack {
	private:
		int top = -1;
		int size;
		int *arr;

	public:
	    Stack(int n) {
	        size = n;
	        arr = new int[size];
	    }

	    void push(int x) {
	        if (top < size - 1) {
	            ++top;
	            arr[top] = x;
	        } else {
	            cout << "Stack overflow!" << endl;
	        }
	    }

	    int pop() {
	        if (top < 0) {
	            cout << "Stack underflow!" << endl;
	            return -1;
	        } else {
	            return arr[top--];
	        }
	    }

	    int topElement() {
	        if (top < 0) {
	            cout << "Stack underflow!" << endl;
	            return -1;
	        } else {
	            return arr[top];
	        }
	    }

	    int isEmpty() {
	        return top < 0;
	    }
};

