string rot13(string s) { 
    for (int i=0; i<s.length(); i++) 
    {   
        // If uppercase letter 
        if (s[i] >= 'A' && s[i] <= 'Z') 
            s[i] = (s[i] - 'A' + 13) % 26 + 'A'; 
        // if lowercase letter
        else if (s[i] >= 'a' && s[i] <= 'z') 
            s[i] = (s[i] - 'a' + 13) % 26 + 'a'; 
    } 
    return s; 
} 

