def merge_sorted_lists(list1, list2):
    if not list1:
        return list2
    if not list2:
        return list1

    if list1.val < list2.val:
       head = list1
       list1 = list1.next
   else:
       head = list2
       list2 = list2.next

   cur = head

   while list1 and list2:
       if list1.val < list2.val:
           cur.next = list1
           list1 = list1.next
       else:
           cur.next = list2
           list2 = list2.next

       cur = cur.next

   cur.next = list1 if list1 else list2

   return head

class Node {
  int data;
  Node next;
  Node(int data) { 
    this.data = data; 
    next = null;
  }
}

class LinkedList {
  Node head;
  public void insertNode(int data) { 
    Node new_node = new Node(data); 
    if (head == null) { 
        head = new_node;
        return;
    }
    Node last = head;  
    while (last.next != null) {
        last = last.next;
    }
    last.next = new_node; 
  } 
}

