std::string remove_extra_spaces(const std::string& str) { 
    std::string result;

    int n = str.length(); 
    bool isPreviousCharSpace = false; 

    for (int i = 0; i < n; i++) { 
        char ch = str[i]; 

        if (ch == ' ' && !isPreviousCharSpace) { 
            result += ch; 
            isPreviousCharSpace = true; 
        } 

        else if (ch != ' ') { 
            result += ch; 
            isPreviousCharSpace = false; 
        } 
    } 

    return result; 
} 

