public static IEnumerable<int> GenerateFibonacciSequence() {
    int prev = 0;
    int current = 1;
    yield return prev;
    yield return current;
    while (true) {
        int temp = prev + current;
        prev = current;
        current = temp;
        yield return current;
    }
}

