class LinkedList {
    Node* head;

public:
    LinkedList(){ 
         head = NULL; 
    }

    void append(int data) {
        Node* newNode = new Node;
        newNode->data = data;
        newNode->next = NULL;

        if (head == NULL) {
            head = newNode;
        } else {
            Node* temp = head;
            while (temp->next != NULL) {
                temp = temp->next;
            }
            temp->next = newNode;
        }
    }

    void deleteNodeByData(int data) {
        if (head == NULL) {
            return;
        }

        if (head->data == data) {
            Node *temp = head;
            head = head->next;
            delete temp;
            return;
        }

        Node *prev;
        Node *curr = head;

        while(curr != NULL && curr->data != data) {
            prev = curr;
            curr = curr->next;
        }

        prev->next = curr->next;
        delete curr;
        return;
    }


    void printList() { 
        Node* temp = head;
        while (temp != NULL) {
            cout << temp->data << endl; 
            temp = temp->next; 
        } 
    }
};

