void bubbleSort(int arr[], int n, int order) {     
    int i, j; 
    for (i = 0; i < n-1; i++)              
        for (j = 0; j < n-i-1; j++) 
            if (order == 0 && arr[j] > arr[j+1]) 
                swap(&arr[j], &arr[j+1]); 
            else if (order == 1 && arr[j] < arr[j+1])
                swap(&arr[j], &arr[j+1]); 
}

