struct Node {
    int data;
    Node* prev;
    Node* next;
};

class DoublyLinkedList {
private:
    Node* head;
    Node* tail;
public:
    DoublyLinkedList() : head(nullptr), tail(nullptr) {}
    ~DoublyLinkedList();

    void AddFront(int data);
    void AddBack(int data);
    void DeleteFront();
    void DeleteBack();
    void Display();
};

void DoublyLinkedList::AddFront(int data) {
    Node* newNode = new Node;
    newNode->data = data;

    newNode->prev = nullptr;

    if (head == nullptr) {
        newNode->next = nullptr;
        head = newNode;
        tail = newNode;
    }
    else {
        head->prev = newNode;
        newNode->next = head;
        head = newNode;
    }
}

void DoublyLinkedList::AddBack(int data) {
    Node* newNode = new Node;
    newNode->data = data;
    newNode->next = nullptr;

    if (tail == nullptr) {
        newNode->prev = nullptr;
        head = newNode;
        tail = newNode;
    }
    else {
        tail->next = newNode;
        newNode->prev = tail;
        tail = newNode;
    }
}

void DoublyLinkedList::DeleteFront() {
    if (head == nullptr) {
        return;
    }
    else if (head->next == nullptr) {
        delete head;
        head = nullptr;
        tail = nullptr;
        return;
    }
    else {
        Node* tmp = head;
        head = head->next;
        delete tmp;
        head->prev = nullptr;
    }
}

void DoublyLinkedList::DeleteBack() {
    if (tail == nullptr) {
        return;
    }
    else if (tail->prev == nullptr) {
        delete tail;
        head = nullptr;
        tail = nullptr;
        return;
    }
    else {
        Node* tmp = tail;
        tail = tail->prev;
        delete tmp;
        tail->next = nullptr;
    }
}

void DoublyLinkedList::Display() {
    Node* tmp = head;

    while (tmp != nullptr) {
        std::cout << tmp->data << " ";
        tmp = tmp->next;
    }
}

DoublyLinkedList::~DoublyLinkedList() {
    Node* tmp = head;

    while (tmp != nullptr) {
        Node* next = tmp->next;
        delete tmp;
        tmp = next;
    }
}

public class BinarySearch2D
{
    public void Search(int[,] matrix, int target)
    {
        if (matrix == null || matrix.GetLength(0) == 0 || matrix.GetLength(1) == 0) 
            return;

        int rows = matrix.GetLength(0);
        int columns = matrix.GetLength(1);

        int row = 0;
        int column = columns - 1;

        while (row < rows && column >= 0)
        {
            if (matrix[row, column] == target)
            {
                Console.WriteLine($"Target found at row: {row} and column: {column}");
                return;
            }
            else if (matrix[row, column] > target)
            {
                column--;
            }
            else
            {
                row++;
            }
        }
    }
}

