// function to reverse the words of a string 
std::string reverseWords(std::string str) 
{ 
	std::string revString = ""; 
	int length = str.length(); 

	// Traverse given string from end 
	for (int i = length - 1; i >= 0; i--) { 
		// if (str[i] == ' ') 
			// continue; 

		// Store next word 
		std::string temp = ""; 
		while (i >= 0 && str[i] != ' ') { 
			temp = temp + str[i]; 
			i--; 
		} 

		// Append next word to result 
		revString = revString + temp + " "; 
	} 

	return revString; 
}

