int max_sum(int arr[], int n) 
{ 
    if (n == 0) 
        return 0; 

    int max = arr[0]; 
    int sum = arr[0]; 

    for (int i = 1; i < n; i++) { 

        if (arr[i] < 0) 
            return 0; 

        sum = max(sum + arr[i], arr[i]); 
        max = max(max, sum); 
    } 

    return max; 
} 
