bool is_palindrome(std::string str) 
{ 
    int i = 0; 
    int j = str.length() - 1; 

    while (i < j) 
    { 
        if (str[i] != str[j]) 
            return false; 

        i++; 
        j--; 
    } 

    return true; 
} 

