public class Stack {

    private int[] stackArray;
    private int maxSize;
    private int top;

    public Stack(int size) {
        maxSize = size;
        stackArray = new int[maxSize];
        top = -1;
    }

    public void push(int item) {
        stackArray[++top] = item;
    }

    public int pop() {
        return stackArray[top--];
    }

    public int peek() {
        return stackArray[top];
    }

    public boolean isEmpty() {
        return (top == -1);
    }
}

def DFS(root):
    S = []
    visited = []

    S.append(root)

    while len(S) > 0:
        node = S.pop()
        visited.append(node)

        for vertex in node.get_adjacent_vertices():
            if vertex not in visited:
                S.append(vertex)
    return visited

