void printPattern(int n) 
{ 
    int i, j, num; 
    num = 1; 

    // Prints the upper half  
    for (i = 0; i <= n; i++) { 
        // Start with printing number 1 
        num = 1; 

        // Print 2*i+1 stars 
        for (j = 0; j < 2 * i + 1; j++) { 
            cout << num << " "; 
            if (i % 2 == 0)  
                num++;   
            else
                num--; 
        } 

        // Move to the next line 
        cout << endl; 
    } 

    // Prints the lower half  
    for (i = n; i > 0; i--) { 
        // Start with printing number 1 
        num = 1; 

        // print 2*i-1 stars 
        for (j = 0; j < 2 * i - 1; j++) { 
            cout << num << " "; 
            if (i % 2 == 0)  
                num++;   
            else
                num--; 
        } 

        // Move to the next line 
        cout << endl; 
    } 
} 

