public static boolean isPrime(int number) { 
    if (number == 2 || number == 3) return true; 
    if (number % 2 == 0 || number % 3 == 0) return false; 
    int sqrtN = (int)Math.sqrt(number) + 1; 
    for (int i = 6; i <= sqrtN; i += 6) { 
        if (number % (i - 1) == 0 || number % (i + 1) == 0) 
            return false; 
    } 

    return true; 
}

