{ 
    static int fib(int n) 
    { 
    	int f[] = new int[n+2]; // 1 extra to handle case, n = 0 
   	 	int i; 

    	/* 0th and 1st number of the series are 0 and 1*/
    	f[0] = 0; 
    	f[1] = 1; 

    	for (i = 2; i <= n; i++) 
    	{ 
    		f[i] = f[i-1] + f[i-2]; 
    	} 

    	return f[n]; 
    } 

