def split_list(list):
    start = 0
    end = len(list) - 1

    left_sum = 0
    right_sum = sum(list[start:end+1])

    while start < end:
        right_sum -= list[end]
        if left_sum == right_sum:
            break
        left_sum += list[start]
        start += 1

    if left_sum == right_sum:
        return list[:start], list[start:]
    else:
        return None

