public class Stack {
    private int[] arr;
    private int top;
    private int capacity;

    public Stack(int capacity) {
        this.arr = new int[capacity];
        this.top = -1;
        this.capacity = capacity;
    }

    public boolean isFull() {
        return top == capacity - 1;
    }

    public boolean isEmpty() {
        return top == -1;
    }

    public int size() {
        return top + 1;
    }

    public void push(int x) {
        if(isFull()) {
            return;
        }
        top++;
        arr[top] = x;
    }

    public int pop() {
        if(isEmpty()) {
            return -1;
        }
        int popped = arr[top];
        top--;
        return popped;
    }
}

