// Utility function to create a linked list
Node* createLinkedList(int arr[], int n)
{
    Node* head = new Node();
    Node* temp = head;
    for (int i = 0; i < n; i++) {
        Node* newNode = new Node();
        newNode->data = arr[i];
        temp->next = newNode;
        temp = temp->next;
    }
    temp->next = nullptr;
    return head;
}

