public class LongestIncreasingSubsequence {

    public static int longestSubsequence (int[] nums) {
        // Base case
        if (nums.length == 0) {
            return 0;
        }

        int[] dp = new int[nums.length];
        dp[0] = 1;
        int maxLength = 1;

        for (int i=1; i < nums.length; i++) {
            int temp = 0;
            for (int j=0; j < i; j++) {
                if (nums[j] < nums[i]) {
                    temp = Math.max(dp[j], temp);
                }
            }

            dp[i] = temp + 1;
            maxLength = Math.max(dp[i], maxLength);
        }

        return maxLength;
    }
}

