def coinChange(coins, amount):
    dp = [float("inf")] * (amount + 1)
    dp[0] = 0

    for coin in coins:
        for x in range(coin, amount + 1):
            dp[x] = min(dp[x], dp[x - coin] + 1)
    if dp[amount] == float("inf"):
        return -1
    return dp[amount]

def binary_search(array, target):
  low = 0
  high = len(array)-1
  while low <= high:
    mid = (low+high)//2
    if array[mid] == target:
      return mid
    elif array[mid] < target:
      low = mid+1
    else:
      high = mid-1
  return -1 # target not found

