def pig_latin(sentence):
    vowel = ["a", "e", "i", "o", "u"]
    words = sentence.split(" ")
    pig_latin_words = []

    for word in words:
        if word[0] in vowel:
            pig_latin_words.append(word + "way")
        else:
            pig_latin_words.append(word[1:] + word[0] + "ay")

