   int min_cost = 0; 

   // Choose items that add up to max_cost or less
   for (Item item : budget_items) {
      if ((min_cost + item.cost) <= max_cost) {
         min_cost += item.cost;
      } 
   } 

   return min_cost; 
} 

int main() {
   int max_cost = 500;
   std::vector<Item> budget_items = {
         {100, "PrintBook"},
         {250, "EditBook"}
   };

   int min_cost = minimizeCost(max_cost, budget_items);
   std::cout << "Min cost: " << min_cost << std::endl;

   return 0;
}

