"""
Find the greatest common divisor for two integer inputs using the Euclidean Algorithm
"""

def greatest_common_divisor(int1, int2):
  if int1 == 0:
    return int2
  elif int2 == 0:
    return int1
  elif int1 == int2:
    return int1
