//Reusable "push" and "pop" functions

void push(Stack *st, int val) {
    st->arr[st->top] = val;
    st->top++;
}

int pop(Stack *st) {
    return st->arr[--(st->top)];
}

//Functions for performing operations

int add(Stack *st) {
    int x = pop(st);
    int y = pop(st);
    return x + y;
}

int subtract(Stack *st) {
    int x = pop(st);
    int y = pop(st);
    return x - y;
}

int multiply(Stack *st) {
    int x = pop(st);
    int y = pop(st);
    return x * y;
}

int divide(Stack *st) {
    int x = pop(st);
    int y = pop(st);
    return x / y;
}

