# Using a hash table, construct a program to find all of the pairs of an array whose sum is equal to a given target

def find_pairs(arr, target):
    seen = {}
    pairs = []
    for num in arr:
        if target-num in seen:
            pairs.append((num, target-num))
        seen[num] = True
    return pairs

