# Defining a node 
Node <- function(value){	 
   this$value <- value
   this$next <- NULL
   return(this)
} 

# Defining a Linked List 
LinkedList <- function(){ 
   this$head <- NULL
   this$tail <- NULL

   # Function to add an element in the linked list 
   addNode <- function(value){
        newnode <- Node(value) 

        # If the Linked List has no node 
        if(is.null(this$head)){ 
            this$head <- newnode
            this$tail <- newnode 
        } else { 

            # Point tail node to newly added node
            this$tail$next <- newnode 
            this$tail <- newnode 
        } 

        # Return the new linked list
        return(this) 
   } 

   # Return the linked list
   return(list(addNode = addNode)) 
}

public class MatrixMultiplication 
{
    static int N = 5; 

    static int[][] multiply(int[][] A,  
                     int[][] B) 
    { 
        int[][] C = new int[N][N]; 

        for (int i = 0; i < N; i++) 
        { 
            for (int j = 0; j < N; j++) 
            { 
                for (int k = 0; k < N; k++) 
                { 
                    C[i][j] += A[i][k] * B[k][j]; 
                } 
            } 
        } 
        return C; 
    } 

    static void printMatrix 
                           (int[][] matrix) 
    { 
        for (int i = 0; i < N; i++) 
        { 
            for (int j = 0; j < N; j++) 
            { 
                System.out.print(matrix[i][j] + " "); 
            } 
            System.out.println(); 
        } 
    } 

    public static void main (String[] args) 
    { 
        int[][] A = { { 1, 1, 1 },  
                      { 2, 2, 2 },  
                      { 3, 3, 3 },  
                      { 4, 4, 4 },  
                      { 5, 5, 5 } }; 

        int[][] B = { { 1, 1, 1 },  
                      { 2, 2, 2 },  
                      { 3, 3, 3 },  
                      { 4, 4, 4 },  
                      { 5, 5, 5 } }; 

        int[][] C = multiply(A, B); 
        printMatrix(C); 
    } 
}

